  `URL` text NOT NULL COMMENT '对应路径',
  `NAME` varchar(64) NOT NULL COMMENT '房子名称',
  `LOCATION` varchar(64) NOT NULL COMMENT '位置',
  `AREA` varchar(64) NOT NULL COMMENT '面积',
  `HOUSETYPE` varchar(64) NOT NULL COMMENT '户型',
  `FLOOR` varchar(11) NOT NULL COMMENT '楼层',
  `LNG` varchar(32) NOT NULL COMMENT '经纬度',
  `LAT` varchar(32) NOT NULL COMMENT '经纬度',
  `PRICE` varchar(32) NOT NULL COMMENT '价格',
  `IS_SAIL` char(1) NOT NULL DEFAULT '1' COMMENT '是否已经卖了（1没卖2卖了）(已出租我要看房)',
  `ICON` text COMMENT '住房图片',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=3620 DEFAULT CHARSET=utf8;

